   * @param {number} number
   * @returns {number}
   */
  static even (number) {
    return number % 2 === 1 ? ++number : number
  }

  /**
   * Returns a random number that may be interesting
   * @returns {number}
   */
  static interesting () {
    return random.choose([
      [50, [-128, -1, 0, 1, 16, 32, 64, 100, 127]],
      [30, [-32768, -129, 128, 255, 256, 512, 1000, 1024, 4096, 32767]],
